            "type": "Annotation",
            "predicate": "http://www.w3.org/ns/shex-xmi#comment",
            "object": {
              "value": "Definition\r\n============\r\nIn Allen's Interval Algebra there are thirteen temporal interval relations: twelve asymmetric ones, i.e. <i>precedes</i>, <i>meets</i>, <i>overlaps</i>, <i>finishes</i>, <i>contains</i>, <i>starts</i> and their converses, plus <i>equals</i>, which is the only one that has no converse or, rather, it is the same as its converse. Together these relations are distinct (any pair of definite intervals are described by one and only one of the relations), exhaustive (any pair of definite intervals are described by one of the relations), and qualitative (no numeric time spans are considered).\r\n\r\n",
              "type": "https://github.com/commonmark/commonmark.js"
            }
