                  "value": "Definition\r\n============\r\nScript is a collection of statements written in a programming language. Some statements may perform actions on an InformationObject. Other statements may control the performance of these action statement. In scripts control is often dependent on the order of statements, and the order is often implicit.  A Script is a specialization of a Program (ProvONE) which is the specialization of a Plan (PROV-O) in which order is often implicit\r\n\r\nExamples\r\n==========\r\nA Stata script\r\n\r\nExplanatory notes\r\n===================\r\nA Script statement performs an action either conditionally or unconditionally so a component of the statement might be a ControlConstruct.\r\n\r\nSynonyms\r\n==========\r\nComputer program\r\n\r\n\r\n",
